import DanielImage1 from "../client/assets/E2A8E2CF-6187-4AEE-836F-4B507475648A.jpeg";
import DanielImage2 from "../client/assets/C8EEF4E1-FA34-49A5-B0D4-08C31FEE0B59_1_105_c.jpeg";

const Home = () => {
    return (
        <>
            <h1>Daniel Farrell</h1>
            <h2>I'm a Full Stack Web Developer</h2>
            <p>Scroll down to get to know me a bit better!</p>
            <img src={DanielImage1} alt="Daniel Farrell" />
            <img src={DanielImage2} alt="Daniel Farrell" />
        </>
    );
};

export default Home;
